DROP TABLE INFRACOES;

CREATE TABLE PROJUDI.INFRACOES 
(	
    LEI                         VARCHAR2(26 BYTE), 
	ARTIGO                      VARCHAR2(26 BYTE), 
	PARAGRAFO                   VARCHAR2(26 BYTE), 
	INCISO                      VARCHAR2(26 BYTE), 
	INFRACAO                    VARCHAR2(128 BYTE), 
	TIPO                        VARCHAR2(128 BYTE), 
	RITO                        VARCHAR2(26 BYTE), 
	SIGILOSA                    VARCHAR2(26 BYTE), 
	ID_ASSUNTO                  NUMBER(10,0), 
	LEI_N                       VARCHAR2(26 BYTE), 
	ID_INFRACOES                NUMBER(10,0)
);

CREATE UNIQUE INDEX PROJUDI.INFRACOES_IDX1 ON PROJUDI.INFRACOES (ID_INFRACOES);

ALTER TABLE PROJUDI.INFRACOES ADD CONSTRAINT PK_INFRACOES PRIMARY KEY(ID_INFRACOES);	

CREATE SEQUENCE PROJUDI.SEQ_INFRACOES MINVALUE 1 MAXVALUE 9999999999999999999999 INCREMENT BY 1 START WITH 2425 NOCACHE  NOORDER  NOCYCLE;

CREATE OR REPLACE TRIGGER PROJUDI.TRG_INFRACOES
BEFORE INSERT ON INFRACOES
REFERENCING NEW AS new 
FOR EACH ROW
DECLARE
v_newVal NUMBER(10) := 0;
BEGIN
    IF INSERTING AND :new.ID_INFRACOES IS NULL THEN
      SELECT SEQ_INFRACOES.NEXTVAL INTO v_newVal FROM DUAL;      
      :new.ID_INFRACOES := v_newVal;
    END IF;
END;

ALTER TRIGGER PROJUDI.TRG_INFRACOES ENABLE;

CREATE OR REPLACE VIEW PROJUDI.VIEW_INFRACOES  AS 
  SELECT LEI,ARTIGO,PARAGRAFO,INCISO,INFRACAO,TIPO,RITO,SIGILOSA,ID_ASSUNTO,LEI_N,ID_INFRACOES FROM PROJUDI.INFRACOES;

